content: "**説明:** 映画「エイリアン」に登場するエイリアンのオブジェに彫られている「ALIEN」の文字。日本人が目視しながら音読すると英語の知識があっても「ありえん」と読んでしまう。
**回収日:** 20██/10/██
**回収場所:** 群馬県██市の映画シアター
**現状:** サイト-8181の低危険物収容ロッカーに保管
**追記:** //そんなことないだろ。//‐空井博士
//だったら声に出して読んでくださいよ、ほら。//‐鉄研究員
//どれどれ…。なんだ、「ありえん」じゃないか…あ。//‐空井博士
//どうでしたか？//‐鉄研究員
//…ありえん…。//‐空井博士"
